  false,\n\t\"url\": null,\n\t\"notes\": \"This Forest Management Plan is a long term
  (80 year) document presents the specific silviculture prescriptions to transform
  the maximum amount of habitat within the James River National Wildlife Refuge into
  premium bald eagle roosting and nesting habitat. The techniques outlined in this
  plan will maximize the number and use of refuge nocturnal roost sites, increase
  the use of the refuge diurnal feeding roost, and transform the James River National
  Wildlife Refuge into a World Class showcase for the management of the bald eagles
  in the Eastern North America.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
